import React, { useState } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, ScrollView } from 'react-native';
import COLORS from '../colors';

const MoodTracker = ({ onMoodUpdate }) => {
  const [selectedActivity, setSelectedActivity] = useState(null);
  const [trackedMoods, setTrackedMoods] = useState([]);

  const moods = [
    { value: 1, emoji: 'ðŸ˜–', label: 'Terrible' },
    { value: 2, emoji: 'ðŸ˜”', label: 'Bad' },
    { value: 3, emoji: 'ðŸ˜', label: 'Neutral' },
    { value: 4, emoji: 'ðŸ™‚', label: 'Good' },
    { value: 5, emoji: 'ðŸ˜„', label: 'Great' },
  ];

  // Mock list of recent activities
  const recentActivities = [
    { id: '1', title: 'Morning Workout', category: 'grind' },
    { id: '2', title: 'Team Meeting', category: 'work' },
    { id: '3', title: 'Project Planning', category: 'work' },
    { id: '4', title: 'Lunch Break', category: 'leisure' },
    { id: '5', title: 'Coding Session', category: 'grind' },
  ];

  const handleSelectActivity = (activity) => {
    setSelectedActivity(activity);
  };

  const handleMoodSelect = (mood) => {
    if (!selectedActivity) return;

    const newMoodEntry = {
      id: Date.now().toString(),
      activityId: selectedActivity.id,
      activityTitle: selectedActivity.title,
      category: selectedActivity.category,
      moodValue: mood.value,
      moodLabel: mood.label,
      moodEmoji: mood.emoji,
      timestamp: new Date().toISOString(),
    };

    const updatedMoods = [...trackedMoods, newMoodEntry];
    setTrackedMoods(updatedMoods);
    onMoodUpdate(updatedMoods);

    // Reset selected activity
    setSelectedActivity(null);
  };

  // Calculate average mood if there are tracked moods
  const averageMood = trackedMoods.length 
    ? (trackedMoods.reduce((sum, entry) => sum + entry.moodValue, 0) / trackedMoods.length).toFixed(1)
    : null;

  return (
    <View style={styles.container}>
      <View style={styles.headerContainer}>
        <Text style={styles.title}>Mood Tracker</Text>
        {averageMood && (
          <View style={styles.averageMoodContainer}>
            <Text style={styles.averageLabel}>Today's Average</Text>
            <Text style={styles.averageValue}>{averageMood}/5</Text>
          </View>
        )}
      </View>

      <Text style={styles.subtitle}>Track how you feel after completing activities</Text>

      {!selectedActivity ? (
        <View>
          <Text style={styles.sectionTitle}>Select an activity:</Text>
          <ScrollView style={styles.activityList} horizontal={false}>
            {recentActivities.map(activity => (
              <TouchableOpacity
                key={activity.id}
                style={[
                  styles.activityItem,
                  { borderLeftColor: getCategoryColor(activity.category) }
                ]}
                onPress={() => handleSelectActivity(activity)}
              >
                <Text style={styles.activityItemTitle}>{activity.title}</Text>
                <Text style={styles.activityCategory}>
                  {activity.category.charAt(0).toUpperCase() + activity.category.slice(1)}
                </Text>
              </TouchableOpacity>
            ))}
          </ScrollView>
        </View>
      ) : (
        <View>
          <Text style={styles.sectionTitle}>
            How did you feel after "{selectedActivity.title}"?
          </Text>
          <View style={styles.moodSelector}>
            {moods.map(mood => (
              <TouchableOpacity
                key={mood.value}
                style={styles.moodOption}
                onPress={() => handleMoodSelect(mood)}
              >
                <Text style={styles.moodEmoji}>{mood.emoji}</Text>
                <Text style={styles.moodOptionLabel}>{mood.label}</Text>
              </TouchableOpacity>
            ))}
          </View>
          <TouchableOpacity
            style={styles.cancelButton}
            onPress={() => setSelectedActivity(null)}
          >
            <Text style={styles.cancelButtonText}>Cancel</Text>
          </TouchableOpacity>
        </View>
      )}

      {trackedMoods.length > 0 && !selectedActivity && (
        <View>
          <Text style={styles.sectionTitle}>Your Mood History:</Text>
          <ScrollView style={styles.moodList}>
            {trackedMoods.map(entry => (
              <View key={entry.id} style={styles.moodEntry}>
                <View style={styles.moodInfo}>
                  <Text style={styles.activityTitle}>{entry.activityTitle}</Text>
                  <Text style={styles.timestamp}>
                    {new Date(entry.timestamp).toLocaleTimeString([], {hour: '2-digit', minute:'2-digit'})}
                  </Text>
                </View>
                <View style={[styles.moodBadge, { backgroundColor: getCategoryColor(entry.category) }]}>
                  <Text style={styles.moodEmoji}>{entry.moodEmoji}</Text>
                  <Text style={styles.moodLabel}>{entry.moodLabel}</Text>
                </View>
              </View>
            ))}
          </ScrollView>
        </View>
      )}
    </View>
  );
};

// Helper function to get color based on category
const getCategoryColor = (category) => {
  switch (category) {
    case 'work': return COLORS.primary;
    case 'leisure': return COLORS.success;
    case 'grind': return COLORS.secondaryDark;
    default: return COLORS.secondary;
  }
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: COLORS.cardBackground,
    borderRadius: 12,
    padding: 16,
    marginVertical: 10,
    shadowColor: COLORS.black,
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
    borderLeftWidth: 4,
    borderLeftColor: COLORS.primary,
  },
  headerContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 8,
  },
  title: {
    fontSize: 18,
    fontWeight: 'bold',
    color: COLORS.black,
  },
  subtitle: {
    fontSize: 14,
    color: COLORS.secondaryDark,
    marginBottom: 15,
  },
  averageMoodContainer: {
    alignItems: 'center',
    backgroundColor: COLORS.secondaryLight,
    paddingHorizontal: 10,
    paddingVertical: 5,
    borderRadius: 15,
  },
  averageLabel: {
    fontSize: 12,
    color: COLORS.secondaryDark,
  },
  averageValue: {
    fontSize: 16,
    fontWeight: 'bold',
    color: COLORS.success,
  },
  sectionTitle: {
    fontSize: 16,
    fontWeight: '600',
    color: COLORS.black,
    marginTop: 12,
    marginBottom: 8,
  },
  activityList: {
    maxHeight: 200,
  },
  activityItem: {
    padding: 12,
    borderLeftWidth: 4,
    marginBottom: 8,
    backgroundColor: COLORS.secondaryLight,
    borderRadius: 6,
  },
  activityItemTitle: {
    fontSize: 16,
    fontWeight: '500',
    color: COLORS.black,
  },
  activityCategory: {
    fontSize: 12,
    color: COLORS.secondaryDark,
    marginTop: 3,
  },
  moodSelector: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginVertical: 15,
  },
  moodOption: {
    alignItems: 'center',
    padding: 10,
    marginHorizontal: 2,
    backgroundColor: COLORS.secondaryLight,
    borderRadius: 8,
    flex: 1,
  },
  moodEmoji: {
    fontSize: 24,
    marginBottom: 5,
  },
  moodOptionLabel: {
    fontSize: 12,
    color: COLORS.black,
    fontWeight: '500',
    textAlign: 'center',
  },
  cancelButton: {
    backgroundColor: COLORS.secondary,
    paddingVertical: 10,
    borderRadius: 6,
    alignItems: 'center',
    marginTop: 10,
  },
  cancelButtonText: {
    color: COLORS.white,
    fontWeight: '500',
  },
  moodList: {
    maxHeight: 200,
  },
  moodEntry: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingVertical: 10,
    borderBottomWidth: 1,
    borderBottomColor: COLORS.secondaryLight,
  },
  moodInfo: {
    flex: 1,
  },
  activityTitle: {
    fontSize: 14,
    fontWeight: '500',
    color: COLORS.black,
  },
  timestamp: {
    fontSize: 12,
    color: COLORS.secondaryDark,
    marginTop: 2,
  },
  moodBadge: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 6,
    borderRadius: 15,
    minWidth: 90,
    justifyContent: 'center',
  },
  moodLabel: {
    color: COLORS.white,
    fontWeight: '600',
    fontSize: 12,
    marginLeft: 4,
  },
});

export default MoodTracker;
